INSERT INTO `novel` VALUES (38, 'https://www.biquge5200.cc/52_52542/', '圣墟', '辰东', '玄幻小说', '在破败中崛起，在寂灭中复苏。 <br> 沧海成尘，雷电枯竭，那一缕幽雾又一次临近大地，世间的枷锁被打开了，一个全新的世界就此揭开神秘的一角……', 'http://r.m.biquge5200.cc/cover/aHR0cDovL3FpZGlhbi5xcGljLmNuL3FkYmltZy8zNDk1NzMvMTAwNDYwODczOC8xODA=', '2018-05-19 07:02:17', '2018-05-19 07:02:17', NULL, '1');
INSERT INTO `novel` VALUES (39, 'https://www.biquge5200.cc/75_75597/', '我是至尊', '风凌天下', '玄幻小说', '药不成丹只是毒，人不成神终成灰。 <br> ………… <br> 天道有缺，人间不平，红尘世外，魍魉横行；哀尔良善，怒尔不争；规则之外，吾来执行。 <br> 布武天下，屠尽不平；手中有刀，心中有情；怀中美人，刀下奸雄；冷眼红尘，无憾今生。 <br> …… <br> 惊天智谋，踏破国仇家恨；铁骨柔肠，演绎爱恨情仇；绝世神功，屠尽人间不平；丹心碧血，谱写兄弟千秋！', 'http://r.m.biquge5200.cc/cover/aHR0cDovL3FpZGlhbi5xcGljLmNuL3FkYmltZy8zNDk1NzMvMTAwNTk4Njk5NC8xODA=', '2018-05-19 07:02:28', '2018-05-19 07:02:28', NULL, '1');
